mql:
db.providers.aggregate([
    {$match: {"NAME": "Iva908 O'Keefe54"}},
    {$lookup: {
        from: "organizations",
        localField: "ORGANIZATION_REF",
        foreignField: "ORGANIZATION_ID",
        as: "_providers"
    }},
    {$unwind: "$_providers"},
    {$project: {_id: 0, name: "$_providers.NAME"}}
])
